import React from 'react';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>AI交友网站</h1>
        <p>欢迎来到AI交友平台</p>
      </header>
      <main>
        <p>这是AI交友网站的主页面</p>
      </main>
    </div>
  );
}

export default App;
